CREATE DEFINER=`root`@`localhost` PROCEDURE `spIncidencias`(in fechaInicio date,fechaFin date, idUsr int)
begin
declare entrada time;
declare salida time;
declare tipoInc char;
declare clave char(6);
declare fecha date;
declare diferencia time;
declare acabo boolean default false;
declare cursorEmpleados cursor for select  ccveemp from ddatemp where cstatus like 'A';
declare continue handler for not found set acabo = true;
if(fechaInicio <= fechafin) then
	drop table if exists registros;
	create temporary table registros(
		clave char(6),
		maximo datetime,
		minimo datetime,
		fecha date);
	insert into registros 
		select ccveemp as clave,  max(dfecreg) as maximo, min(dfecreg) as minimo,cast(dfecreg as date) as fecha from pregasi
			where cast(dfecreg as date) between fechaInicio and fechaFin
			group by cast(dfecreg as date), ccveemp;
    -- por cada dia desde la fecha de inicio hasta la fecha de fin

	open cursorEmpleados;
            -- para cada empleado activo
	recorre: loop 
		set fecha=fechaInicio;
		fetch cursorEmpleados into clave;
		if acabo then
			leave recorre;
		end if;
		while(fecha<=fechaFin) do
		-- si es dia laborable
			if (select count(*) from mdiasnl where dfechnl = fecha) = 0 then
				if(select count(*) from registros r where r.clave=clave and r.fecha=fecha)=0 then
					-- no fue ese dia
					if(select count(*) from dhremps h, ddethor d where d.nidhora=h.nidhora and d.ndiasem=dayofweek(fecha) and h.ccveemp=clave and d.cstatus like'A') = 1 then
						-- debi haber ido
						if(select count(*) from tincemp where ccveemp =clave and dfecinc=fecha and ctipinc='D')=0 then
							insert into tincemp (ccveemp, dfecinc, ctipinc, cusuins, dfecins) values (clave, fecha, 'D', (select DUSUARI from dinises where DIDEUSR = idUsr), curdate());
						end if;
					end if;
				else
					set entrada=(select cast(r.minimo as time) from registros r where r.clave=clave and r.fecha=fecha);
					set salida=(select cast(r.maximo as time) from registros r where r.clave=clave and r.fecha=fecha);
					if(timediff(salida,
					(select cast(d.chorsal as time) from dhremps h, ddethor d where d.nidhora=h.nidhora and d.ndiasem=dayofweek(fecha) and h.ccveemp=clave and d.cstatus like'A')))<'00:00:00' or
					(timediff(entrada,
					(select cast(d.chorent as time) from dhremps h, ddethor d where d.nidhora=h.nidhora and d.ndiasem=dayofweek(fecha) and h.ccveemp=clave and d.cstatus like'A')))>'00:10:59' then
						set diferencia=timediff(salida,entrada);
						-- entrada y salida igual
                        set tipoInc='';
						if diferencia =  0 then
							set tipoInc='O';
						else
							set diferencia=timediff(salida,
								(select cast(d.chorsal as time) from dhremps h, ddethor d where d.nidhora=h.nidhora and d.ndiasem=dayofweek(fecha) and h.ccveemp=clave and d.cstatus like'A'));
                                if diferencia <'00:00:00' then
									set tipoInc='A';
								end if;
						end if;
                        if(tipoInc='A' or tipoInc='O' )and(select count(*) from tincemp where ccveemp =clave and dfecinc=fecha and (ctipinc='O' or ctipinc='A'))=0 then
							insert into tincemp (ccveemp, dfecinc, ctipinc, cusuins, dfecins) values (clave, fecha, tipoInc, (select DUSUARI from dinises where DIDEUSR = idUsr), curdate());
						end if;
                        set tipoInc='';
                        set diferencia=timediff(entrada,
							(select cast(d.chorent as time) from dhremps h, ddethor d where d.nidhora=h.nidhora and d.ndiasem=dayofweek(fecha) and h.ccveemp=clave and d.cstatus like'A'));
						if diferencia > '00:30:59' then
							set tipoInc='T';
						else
							if diferencia > '00:20:59' then
								set tipoInc='Y';
							else
								if diferencia >'00:10:59' then
									set tipoInc='N';
								end if;
							end if;
						end if;
						if (tipoInc = 'T' or tipoInc = 'Y' or tipoInc = 'N') and (select count(*) from tincemp where ccveemp =clave and dfecinc=fecha and ctipinc in ('T','Y','N'))=0 then
							insert into tincemp (ccveemp, dfecinc, ctipinc, cusuins, dfecins) values (clave, fecha, tipoInc, (select DUSUARI from dinises where DIDEUSR = idUsr), curdate());
						end if;
					end if;
				end if;				
			end if;
			set fecha=adddate(fecha,interval 1 day);
		end while;
    end loop recorre;
	close cursorEmpleados;
else
	select 'Fecha inicio mayor que fecha fin' as mensaje;
end if;
select 'Procesado correctamente' as mensaje;
end ;;
DELIMITER ;
