CREATE DEFINER=`root`@`localhost` PROCEDURE `spModificaDetalleHorario`(in idHora decimal(5,0), in diaSemana decimal(1,0),
	in horaEntrada char(5), in horaSalida char(5), in idUsr int, in estatus char(1))
begin
declare existe int;
declare usuario varchar(20);

set existe=(select count(*) from CHORARS where CHORARS.NIDHORA = idHora);
if existe>0 then
	set existe=(select count(*) from DDETHOR d where d.NIDHORA=idHora and d.NDIASEM=diaSemana);
    if existe=1 then
		set usuario =(select i.DUSUARI from DINISES i where i.DIDEUSR = idUsr);
        update DDETHOR set
        CHORENT=horaEntrada,CHORSAL=horaSalida,CSTATUS=estatus,CUSUMOD=usuario, DFECMOD=curdate()
        where NIDHORA=idHora and NDIASEM=diaSemana;
		select 1 as resultado, 'Detalle modificado exitosamente' as mensaje;
	else
		select -2 as resultado, 'Ese detalle no existe' as mensaje;
	end if;
else
	select -1 as resultado, 'El id horario no existe' as mensaje;
end if;
end ;;
