CREATE DEFINER=`root`@`localhost` PROCEDURE `spModificaHorarioEmpleado`(in claveEmpleado char(6), in idHorario decimal(5,0), in idUsr int, in estatus char)
begin
declare existe int;
set existe=(select count(*) from DDATEMP where CCVEEMP = claveEmpleado);
if existe=1 then
	set existe =(select count(*) from CHORARS where NIDHORA = idHorario);
    if existe =1 then
		set existe =(select count(*) from DHREMPS where CCVEEMP = claveEmpleado and NIDHORA = idHorario);
        if existe = 1 then
			update DHREMPS set cstatus = estatus, cusumod = (select i.DUSUARI from DINISES i where i.DIDEUSR = idUsr), dfecmod = curdate()
				where nidhora = idHorario and ccveemp =  claveEmpleado;
			select 1 as resultado, 'Actualizado exitosamente' as mensaje;
		else
			select -2 as resultado, 'Ese empelado no tiene asignado ese horario' as mensaje;
        end if;
	else
		select -1 as resultado, 'Ese horario no existe' as mensaje;
	end if;
else
	select 0 as resultado, 'Ese empelado no existe' as mensaje;
end if;
end ;;
