CREATE DEFINER=`root`@`localhost` PROCEDURE `spRegistraEmpleado`(in clave char(6), in nombre varchar(35), in apellidoPaterno varchar(35),in apellidoMaterno varchar(35),
	in curp varchar(18), in fechaIngreso date, in calle varchar(35), in numeroExt varchar(35), in numeroInt varchar(35),
    in colonia varchar(50), in codigoPost char(5), in estado varchar(35), in municipio varchar(35),
    in estatus char(1), in usuarioInser int)
begin
declare usuario varchar(30);
declare existe int;
set existe= (select count(*) from DDATEMP d where d.CCURPEM = curp or d.CCVEEMP = clave);
if existe = 0 then
	set usuario =(select i.DUSUARI from DINISES i where i.DIDEUSR = usuarioInser);
    insert into DDATEMP(CCVEEMP,CNOMBRE,CAPEUNO,CAPEDOS,CCURPEM,DFECING,
       CNMCALL,CNUMEXT,CNUMINT,CCOLONI,CCODPOS,NIDESTA,NIDMUNI,CSTATUS, CUSUINS, DFECINS)
values(clave,nombre,apellidoPaterno,apellidoMaterno,curp,fechaIngreso,calle,numeroext,
numeroInt,colonia,codigoPost,(select e.NIDESTA from CESTADS e where e.CNOMEST=estado),(select m.NIDMUNI from CMUNICS m where m.CNOMMUN= municipio),estatus, usuario, curdate());
select 1 as resultado, 'Empleado registrado exitosamente' as mensaje;
else
	select 0 as resultado, 'Ese empelado ya existe' as mensaje;
end if;
end ;;
