CREATE DEFINER=`root`@`localhost` PROCEDURE `spRegistroAsistencia`(in claveEmpleado char(6), in fecha datetime, in biometrico decimal(2,0),
	in estatus char(1), in idUsr int)
begin
declare existe int;
set existe=(select count(*) from DDATEMP where CCVEEMP=claveEmpleado);
if existe=1 then
	set existe=(select count(*) from PREGASI where CCVEEMP=claveEmpleado and DFECREG=fecha);
	if existe=0 then
		insert into PREGASI (CCVEEMP,DFECREG,CNUMBIO,CSTATUS,CUSUINS, DFECINS) values
			(claveEmpleado, fecha, biometrico, estatus, (select i.DUSUARI from DINISES i where i.DIDEUSR = idUsr), curdate());
		select 1 as resultado, 'Registrado' as mensaje;
	else
		select -1 as resultado, 'Ya está registrado' as mensaje;
	end if;
else
		select -1 as resultado, 'Empleado no existe' as mensaje;
end if;
end ;;
